import React, { Component } from 'react'
import styled from 'styled-components';


const Card = styled.div`
    width: 100%;
    height: 260px;
    position: relative;
    overflow: hidden;
    
    &:hover{
        .hover_Card{
            top: 0px;
        }
    }
    img{
        max-width: 100%;
    }
    .hover_card{
        width: 100%;
        height: 100%;
        position: absolute;
        top: -100%;
        bottom: 0px;
        right: 0px;
        left: 0px;
        transition: all 0.2s;
        background-color: #18bc9c;
        display: flex;
        align-items: center;
        justify-content: center;
        font-size: 30px;
        color: #fff;
    }
`;

 class portfolioCard extends Component {
    render() {
    const {logo,title,bigImage,url,description,skill} = this.props.item;
    console.log("logo", logo)

        return (
            <Card onClick={() => alert("hey", this.props.item.id)}>
                <img src={logo} />
                <div className="hover_card">+</div>
            </Card>
        )
    }
}


export default portfolioCard;
